INSERT INTO `domain` VALUES (1,'gnl|CDD|251820','Terminase-like family.  This family represents a group of terminase proteins.','pfam03237','Terminase_6'),(2,'gnl|CDD|251894','Phage Terminase.  The majority of the members of this family are bacteriophage proteins, several of which are thought to be terminase large subunit proteins. There are also a number of bacterial proteins of unknown function.','pfam03354','Terminase_1'),(3,'gnl|CDD|226974','Phage terminase-like protein, large subunit [General function prediction only].','COG4626','COG4626'),(4,'gnl|CDD|253031','Phage portal protein, SPP1 Gp6-like.  This protein forms a hole, or portal, that enables DNA passage during packaging and ejection. It also forms the junction between the phage head (capsid) and the tail proteins. During SPP1 morphogenesis, Gp6 participates in the procapsid assembly reaction. This family also includes the old Pfam family Phage_min_cap (PF05126).','pfam05133','Phage_prot_Gp6'),(5,'gnl|CDD|223910','Methyl-accepting chemotaxis protein [Cell motility and secretion / Signal transduction mechanisms].','COG0840','Tar'),(6,'gnl|CDD|214599','Methyl-accepting chemotaxis-like domains (chemotaxis sensory transducer).  Thought to undergo reversible methylation in response to attractants or repellants during bacterial chemotaxis.','smart00283','MA'),(7,'gnl|CDD|237541','conjugal transfer protein TrbI; Provisional.','PRK13881','PRK13881'),(8,'gnl|CDD|252984','Phage capsid family.  Family of bacteriophage hypothetical proteins and capsid proteins.','pfam05065','Phage_capsid'),(9,'gnl|CDD|273690','phage major capsid protein, HK97 family.  This model family represents the major capsid protein component of the heads (capsids) of bacteriophage HK97, phi-105, P27, and related phage. This model represents one of several analogous families lacking detectable sequence similarity. The gene encoding this component is typically located in an operon encoding the small and large terminase subunits, the portal protein and the prohead or maturation protease. [Mobile and extrachromosomal element functions, Prophage functions].','TIGR01554','prophage_Lp3_protein_18'),(10,'gnl|CDD|177331','capsid protein.','PHA02004','PHA02004'),(11,'gnl|CDD|227699','Phage-related protein [Function unknown].','COG5412','COG5412'),(12,'gnl|CDD|225720','Predicted chitinase [General function prediction only].','COG3179','COG3179'),(13,'gnl|CDD|257848','Peptidase_C39 like family.','pfam13529','Peptidase_C39_2'),(14,'gnl|CDD|239109','A sub-family of peptidase family C39. Peptidase family C39 mostly contains bacteriocin-processing endopeptidases from bacteria. The cysteine peptidases in family C39 cleave the \"double-glycine\" leader peptides from the precursors of various bacteriocins (mostly non-lantibiotic). The cleavage is mediated by the transporter as part of the secretion process. Bacteriocins are antibiotic proteins secreted by some species of bacteria that inhibit the growth of other bacterial species. The bacteriocin is synthesized as a precursor with an N-terminal leader peptide, and processing involves removal of the leader peptide by cleavage at a Gly-Gly bond, followed by translocation of the mature bacteriocin across the cytoplasmic membrane. Most endopeptidases of family C39 are N-terminal domains in larger proteins (ABC transporters) that serve both functions. The proposed protease active site is conserved in this sub-family of proteins with a single peptidase domain, which are lacking the nucleotide-binding transporter signature or have different domain architectures.','cd02549','Peptidase_C39A'),(15,'gnl|CDD|253144','Protein of unknown function (DUF732).  This family consists of several uncharacterized Mycobacterium tuberculosis and leprae proteins of unknown function.','pfam05305','DUF732'),(16,'gnl|CDD|271189','C-terminal catalytic domain of integrases from bacterial phages and conjugate transposons.  This family of tyrosine based site-specific integrases is has origins in bacterial phages and conjugate transposons. One member is the integrase from Bacillus subtilis conjugative transposon ICEBs1. ICEBs1 can be excised and transfered to various recipients in response to DNA damage or high concentrations of potential mating partners. The family belongs to the superfamily of DNA breaking-rejoining enzymes, which share the same fold in their catalytic domain and the overall reaction mechanism. The catalytic domain contains six conserved active site residues. Their overall reaction mechanism involves cleavage of a single strand of a DNA duplex by nucleophilic attack of a conserved tyrosine to give a 3\' phosphotyrosyl protein-DNA adduct. In the second rejoining step, a terminal 5\' hydroxyl attacks the covalent adduct to release the enzyme and generate duplex DNA.','cd01189','INT_ICEBs1_C_like'),(17,'gnl|CDD|249984','Phage integrase family.  Members of this family cleave DNA substrates by a series of staggered cuts, during which the protein becomes covalently linked to the DNA through a catalytic tyrosine residue at the carboxy end of the alignment. The catalytic site residues in CRE recombinase are Arg-173, His-289, Arg-292 and Tyr-324.','pfam00589','Phage_integrase'),(18,'gnl|CDD|274042','tyrosine recombinase XerC.  The phage integrase family describes a number of recombinases with tyrosine active sites that transiently bind covalently to DNA. Many are associated with mobile DNA elements, including phage, transposons, and phase variation loci. This model represents XerC, one of two closely related chromosomal proteins along with XerD (TIGR02225). XerC and XerD are site-specific recombinases which help resolve chromosome dimers to monomers for cell division after DNA replication. In species with a large chromosome and homologs of XerC on other replicons, the chomosomal copy was preferred for building this model. This model does not detect all XerC, as some apparent XerC examples score in the gray zone between trusted (450) and noise (410) cutoffs, along with some XerD examples. XerC and XerD interact with cell division protein FtsK. [DNA metabolism, DNA replication, recombination, and repair].','TIGR02224','Tyrosine_recombinase_XerC'),(19,'gnl|CDD|271177','Shufflon-specific DNA recombinase Rci and Bacteriophage Hp1_like integrase, C-terminal catalytic domain.  Rci protein is a tyrosine recombinase specifically involved in Shufflon type of DNA rearrangement in bacteria. The shufflon of plasmid R64 consists of four invertible DNA segments which are separated and flanked by seven 19-bp repeat sequences. RCI recombinase facilitates the site-specific recombination between any inverted repeats results in an inversion of the DNA segment(s) either independently or in groups. HP1 integrase promotes site-specific recombination of the HP1 genome into that of Haemophilus influenza. Bacteriophage Hp1_like integrases are tyrosine based site specific recombinases. They belong to the superfamily of DNA breaking-rejoining enzymes, which share the same fold in their catalytic domain and the overall reaction mechanism. The catalytic domain contains six conserved active site residues. Their overall reaction mechanism is essentially identical and involves cleavage of a single strand of a DNA duplex by nucleophilic attack of a conserved tyrosine to give a 3\' phosphotyrosyl protein-DNA adduct. In the second rejoining step, a terminal 5\' hydroxyl attacks the covalent adduct to release the enzyme and generate duplex DNA.','cd00796','INT_Rci_Hp1_C'),(20,'gnl|CDD|274043','tyrosine recombinase XerD.  The phage integrase family describes a number of recombinases with tyrosine active sites that transiently bind covalently to DNA. Many are associated with mobile DNA elements, including phage, transposons, and phase variation loci. This model represents XerD, one of two closely related chromosomal proteins along with XerC (TIGR02224). XerC and XerD are site-specific recombinases which help resolve chromosome dimers to monomers for cell division after DNA replication. In species with a large chromosome and with homologs of XerD on other replicons, the chomosomal copy was preferred for building this model. This model does not detect all XerD, as some apparent XerD examples score below the trusted and noise cutoff scores. XerC and XerD interact with cell division protein FtsK. [DNA metabolism, DNA replication, recombination, and repair].','TIGR02225','Tyrosine_recombinase_XerD'),(21,'gnl|CDD|234698','site-specific tyrosine recombinase XerC; Reviewed.','PRK00236','xerC'),(22,'gnl|CDD|271175','DNA breaking-rejoining enzymes, C-terminal catalytic domain.  The DNA breaking-rejoining enzyme superfamily includes type IB topoisomerases and tyrosine based site-specific recombinases (integrases) that share the same fold in their catalytic domain containing conserved active site residues. The best-studied members of this diverse superfamily include Human topoisomerase I, the bacteriophage lambda integrase, the bacteriophage P1 Cre recombinase, the yeast Flp recombinase, and the bacterial XerD/C recombinases. Their overall reaction mechanism is essentially identical and involves cleavage of a single strand of a DNA duplex by nucleophilic attack of a conserved tyrosine to give a 3\' phosphotyrosyl protein-DNA adduct. In the second rejoining step, a terminal 5\' hydroxyl attacks the covalent adduct to release the enzyme and generate duplex DNA. The enzymes differ in that topoisomerases cleave and then rejoin the same 5\' and 3\' termini, whereas a site-specific recombinase transfers a 5\' hydroxyl generated by recombinase cleavage to a new 3\' phosphate partner located in a different duplex region. Many DNA breaking-rejoining enzymes also have N-terminal domains, which show little sequence or structure similarity.','cd00397','DNA_BRE_C'),(23,'gnl|CDD|227307','Site-specific recombinase XerC [DNA replication, recombination, and repair].','COG4973','XerC'),(24,'gnl|CDD|227308','Site-specific recombinase XerD [DNA replication, recombination, and repair].','COG4974','XerD'),(25,'gnl|CDD|271186','Putative Transposase A from transposon Tn554, C-terminal catalytic domain.  This family includes putative Transposase A from transposon Tn554. It belongs to a DNA breaking-rejoining enzyme superfamily. The catalytic domain contains six conserved active site residues. The recombination reaction involves cleavage of a single strand of a DNA duplex by nucleophilic attack of a conserved tyrosine to give a 3\' phosphotyrosyl protein-DNA adduct. In the second rejoining step, a terminal 5\' hydroxyl attacks the covalent adduct to release the enzyme and generate duplex DNA. Many DNA breaking-rejoining enzymes also have N-terminal domains, which show little sequence or structure similarity.','cd01186','INT_tnpA_C_Tn554'),(26,'gnl|CDD|234713','site-specific tyrosine recombinase XerD; Reviewed.','PRK00283','xerD'),(27,'gnl|CDD|222904','integrase; Provisional.','PHA02601','int'),(28,'gnl|CDD|223655','Integrase [DNA replication, recombination, and repair].','COG0582','XerC'),(29,'gnl|CDD|271179','XerD and XerC integrases, C-terminal catalytic domains.  XerDC-like integrases are involved in the site-specific integration and excision of lysogenic bacteriophage genomes, transposition of conjugative transposons, termination of chromosomal replication, and stable plasmid inheritance. They share the same fold in their catalytic domain containing six conserved active site residues and the overall reaction mechanism with the DNA breaking-rejoining enzyme superfamily. In Escherichia coli, the Xer site-specific recombination system acts to convert dimeric chromosomes, which are formed by homologous recombination to monomers. Two related recombinases, XerC and XerD, bind cooperatively to a recombination site present in the E. coli chromosome. Each recombinase catalyzes the exchange of one pair of DNA strand in a reaction that proceeds through a Holliday junction intermediate. These enzymes can bridge two different and well-separated DNA sequences called arm- and core-sites. The C-terminal domain binds, cleaves, and re-ligates DNA strands at the core-sites, while the N-terminal domain is largely responsible for high-affinity binding to the arm-type sites.','cd00798','INT_XerDC_C'),(30,'gnl|CDD|271183','C-terminal catalytic domain of recombinase RitC, a component of the recombinase trio.  Recombinases belonging to the RitA (also known as pAE1 due to its presence in the deletion prone region of plasmid pAE1 of Alcaligenes eutrophus H1), RitB, and RitC families are associated in a complex referred to as a Recombinase in Trio (RIT) element.  These RIT elements consist of three adjacent and unidirectional overlapping genes, one from each family (ritABC in order of transcription).  All three integrases contain a catalytic motif, suggesting that they are all active enzymes.  However, their specific roles are not yet fully understood.  All three families belong to the superfamily of DNA breaking-rejoining enzymes, which share the same fold in their catalytic domain and the overall reaction mechanism.','cd01182','INT_RitC_C_like'),(31,'gnl|CDD|271184','Uncharacterized site-specific tyrosine recombinase, C-terminal catalytic domain.  Tyrosine recombinase (integrase) belongs to a DNA breaking-rejoining enzyme superfamily. The catalytic domain containing six conserved active site residues. The recombination reaction involves cleavage of a single strand of a DNA duplex by nucleophilic attack of a conserved tyrosine to give a 3\' phosphotyrosyl protein-DNA adduct. In the second rejoining step, a terminal 5\' hydroxyl attacks the covalent adduct to release the enzyme and generate duplex DNA. Many DNA breaking-rejoining enzymes also have N-terminal domains, which show little sequence or structure similarity.','cd01184','INT_C_like_1'),(32,'gnl|CDD|271178','C-terminal catalytic domain of recombinase RitB, a component of the recombinase trio.  Recombinases belonging to the RitA (also known as pAE1 due to its presence in the deletion prone region of plasmid pAE1 of Alcaligenes eutrophus H1), RitB, and RitC families are associated in a complex referred to as a Recombinase in Trio (RIT) element.  These RIT elements consist of three adjacent and unidirectional overlapping genes, one from each family (ritABC in order of transcription).  All three integrases contain a catalytic motif, suggesting that they are all active enzymes.  However, their specific roles are not yet fully understood.  All three families belong to the superfamily of DNA breaking-rejoining enzymes, which share the same fold in their catalytic domain and the overall reaction mechanism.','cd00797','INT_RitB_C_like'),(33,'gnl|CDD|271188','C-terminal catalytic domain of recombinase RitA, a component of the recombinase trio.  Recombinases RitA (also known as pAE1), RitB, and RitC are encoded by three adjacent and overlapping genes. Collectively they are known as the Recombinase in Trio (RIT). This RitA family includes various bacterial integrases and integrases from the deletion-prone region of plasmid pAE1 of Alcaligenes eutrophus H1. All three integrases contain a catalytic motif, suggesting that they are all active enzymes. However, their specific roles are not fully understood. All three families belong to the superfamily of DNA breaking-rejoining enzymes, which share the same fold in their catalytic domain and the overall reaction mechanism. The catalytic domain contains six conserved active site residues. Their overall reaction mechanism is essentially identical and involves cleavage of a single strand of a DNA duplex by nucleophilic attack of a conserved tyrosine to give a 3\' phosphotyrosyl protein-DNA adduct. In the second rejoining step, a terminal 5\' hydroxyl attacks the covalent adduct to release the enzyme and generate duplex DNA.','cd01188','INT_RitA_C_like'),(34,'gnl|CDD|271193','Integron integrase and similar protiens, C-terminal catalytic domain.  Integron integrases mediate site-specific DNA recombination between a proximal primary site (attI) and a secondary target site (attC) found within mobile gene cassettes encoding resistance or virulence factors. Unlike other site specific recombinases, the attC sites lack sequence conservation. Integron integrase exhibits broader DNA specificity by recognizing the non-conserved attC sites. The structure shows that DNA target site recognition are not dependent on canonical DNA but on the position of two flipped-out bases that interact in cis and in trans with the integrase. Integron-integrases are present in many natural occurring mobile elements, including transposons and conjugative plasmids. Vibrio, Shewanella, Xanthomonas, and Pseudomonas species harbor chromosomal super-integrons. All integron-integrases carry large inserts unlike the TnpF ermF-like proteins also seen in this group.','cd01193','INT_IntI_C'),(35,'gnl|CDD|182125','tyrosine recombinase; Provisional.','PRK09870','PRK09870'),(36,'gnl|CDD|271182','Bacteriophage P4 integrase, C-terminal catalytic domain.  P4-like integrases are found in temperate bacteriophages, integrative plasmids, pathogenicity and symbiosis islands, and other mobile genetic elements. The P4 integrase mediates integrative and excisive site-specific recombination between two sites, called attachment sites, located on the phage genome and the bacterial chromosome. The phage attachment site is often found adjacent to the integrase gene, while the host attachment sites are typically situated near tRNA genes. This family belongs to the superfamily of DNA breaking-rejoining enzymes, which share the same fold in their catalytic domain and the overall reaction mechanism. The catalytic domain contains six conserved active site residues. Their overall reaction mechanism involves cleavage of a single strand of a DNA duplex by nucleophilic attack of a conserved tyrosine to give a 3\' phosphotyrosyl protein-DNA adduct. In the second rejoining step, a terminal 5\' hydroxyl attacks the covalent adduct to release the enzyme and generate duplex DNA.','cd00801','INT_P4_C'),(37,'gnl|CDD|271194','Uncharacterized site-specific tyrosine recombinase, C-terminal catalytic domain.  Tyrosine recombinase (integrase) belongs to a DNA breaking-rejoining enzyme superfamily. The catalytic domain contains six conserved active site residues. The recombination reaction involves cleavage of a single strand of a DNA duplex by nucleophilic attack of a conserved tyrosine to give a 3\' phosphotyrosyl protein-DNA adduct. In the second rejoining step, a terminal 5\' hydroxyl attacks the covalent adduct to release the enzyme and generate duplex DNA. Many DNA breaking-rejoining enzymes also have N-terminal domains, which show little sequence or structure similarity.','cd01194','INT_C_like_4'),(38,'gnl|CDD|258797','Phage integrase, N-terminal SAM-like domain.  This domain is found in a variety of phage integrase proteins.','pfam14659','Phage_int_SAM_3'),(39,'gnl|CDD|271185','Integrase IntN1 of Bacteroides mobilizable transposon NBU1 and similar proteins, C-terminal catalytic domain.  IntN1 is a tyrosine recombinase for the integration and excision of Bacteroides mobilizable transposon NBU1 from the host chromosome. IntN1 does not require strict homology between the recombining sites seen with other tyrosine recombinases. This family belongs to the superfamily of DNA breaking-rejoining enzymes, which share the same fold in their catalytic domain and the overall reaction mechanism. The catalytic domain contains six conserved active site residues. Their overall reaction mechanism involves cleavage of a single strand of a DNA duplex by nucleophilic attack of a conserved tyrosine to give a 3\' phosphotyrosyl protein-DNA adduct. In the second rejoining step, a terminal 5\' hydroxyl attacks the covalent adduct to release the enzyme and generate duplex DNA.','cd01185','INTN1_C_like'),(40,'gnl|CDD|271197','FimB and FimE and related proteins, integrase/recombinases.  This CD includes proteins similar to E.coli FimE and FimB and Proteus mirabilis MrpI. FimB and FimE are the regulatory proteins during expression of type 1 fimbriae in Escherichia coli. The fimB and fimE proteins direct the phase switch into the \'on\' and \'off\' position. MrpI is the regulatory protein of proteus mirabilis fimbriae expression. This family belongs to the integrase/recombinase superfamily.','cd01197','INT_FimBE_like'),(41,'gnl|CDD|271181','C-terminal catalytic domain of Lambda integrase, a tyrosine-based site-specific recombinase.  Lambda-type integrases catalyze site-specific integration and excision of temperate bacteriophages and other mobile genetic elements to and from the bacterial host chromosome. They are tyrosine-based site-specific recombinase and belong to the superfamily of DNA breaking-rejoining enzymes, which share the same fold in their catalytic domain and the overall reaction mechanism. The phage lambda integrase can bridge two different and well-separated DNA sequences called arm- and core-sites. The C-terminal domain binds, cleaves and re-ligates DNA strands at the core-sites, while the N-terminal domain is largely responsible for high-affinity binding to the arm-type sites.','cd00800','INT_Lambda_C'),(42,'gnl|CDD|111373','Transcription factor WhiB.  WhiB is a putative transcription factor in Actinobacteria, required for differentiation and sporulation.','pfam02467','Whib'),(43,'gnl|CDD|204733','Protein of unknwon function (DUF3310).  This is a family of conserved bacteriophage proteins of unknown function.','pfam11753','DUF3310'),(44,'gnl|CDD|214685','exonuclease domain in DNA-polymerase alpha and epsilon chain, ribonuclease T and other exonucleases.','smart00479','EXOIII'),(45,'gnl|CDD|176648','DEDDh 3\'-5\' exonuclease domain family.  DEDDh exonucleases, part of the DnaQ-like (or DEDD) exonuclease superfamily, catalyze the excision of nucleoside monophosphates at the DNA or RNA termini in the 3\'-5\' direction. These proteins contain four invariant acidic residues in three conserved sequence motifs termed ExoI, ExoII and ExoIII. DEDDh exonucleases are classified as such because of the presence of specific Hx(4)D conserved pattern at the ExoIII motif. The four conserved acidic residues are clustered around the active site and serve as ligands for the two metal ions required for catalysis. Most DEDDh exonucleases are the proofreading subunits (epsilon) or domains of bacterial DNA polymerase III, the main replicating enzyme in bacteria, which functions as the chromosomal replicase. Other members include other DNA and RNA exonucleases such as RNase T, Oligoribonuclease, and RNA exonuclease (REX), among others.','cd06127','DEDDh'),(46,'gnl|CDD|250234','Exonuclease.  This family includes a variety of exonuclease proteins, such as ribonuclease T and the epsilon subunit of DNA polymerase III.;.','pfam00929','RNase_T'),(47,'gnl|CDD|223916','DNA polymerase III, epsilon subunit and related 3\'-5\' exonucleases [DNA replication, recombination, and repair].','COG0847','DnaQ'),(48,'gnl|CDD|236391','DNA polymerase III subunit epsilon; Validated.','PRK09145','PRK09145'),(49,'gnl|CDD|273602','DnaQ family exonuclease/DinG family helicase, putative.  This model represents a family of proteins in Gram-positive bacteria. The N-terminal region of about 200 amino acids resembles the epsilon subunit of E. coli DNA polymerase III and the homologous region of the Gram-positive type DNA polymerase III alpha subunit. The epsilon subunit contains an exonuclease domain. The remainder of this protein family resembles a predicted ATP-dependent helicase, the DNA damage-inducible protein DinG of E. coli. [DNA metabolism, DNA replication, recombination, and repair].','TIGR01407','dinG_rel'),(50,'gnl|CDD|131249','Glutaredoxin-like protein NrdH.  NrdH-redoxin is a representative of a class of small redox proteins that contain a conserved CXXC motif and are characterized by a glutaredoxin-like amino acid sequence and thioredoxin-like activity profile. Unlike other the glutaredoxins to which it is most closely related, NrdH aparrently does not interact with glutathione/glutathione reductase, but rather with thioredoxin reductase to catalyze the reduction of ribonucleotide reductase.','TIGR02194','Glutaredoxin-like_protein_NrdH'),(51,'gnl|CDD|239274','NrdH-redoxin (NrdH) family; NrdH is a small monomeric protein with a conserved redox active CXXC motif within a TRX fold, characterized by a glutaredoxin (GRX)-like sequence and TRX-like activity profile. In vitro, it displays protein disulfide reductase activity that is dependent on TRX reductase, not glutathione (GSH). It is part of the NrdHIEF operon, where NrdEF codes for class Ib ribonucleotide reductase (RNR-Ib), an efficient enzyme at low oxygen levels. Under these conditions when GSH is mostly conjugated to spermidine, NrdH can still function and act as a hydrogen donor for RNR-Ib. It has been suggested that the NrdHEF system may be the oldest RNR reducing system, capable of functioning in a microaerophilic environment, where GSH was not yet available. NrdH from Corynebacterium ammoniagenes can form domain-swapped dimers, although it is unknown if this happens in vivo. Domain-swapped dimerization, which results in the blocking of the TRX reductase binding site, could be a mechanism for regulating the oxidation state of the protein.','cd02976','NrdH'),(52,'gnl|CDD|182381','glutaredoxin-like protein; Provisional.','PRK10329','PRK10329'),(53,'gnl|CDD|223767','Glutaredoxin and related proteins [Posttranslational modification, protein turnover, chaperones].','COG0695','GrxC'),(54,'gnl|CDD|224311','Arsenate reductase and related proteins, glutaredoxin family [Inorganic ion transport and metabolism].','COG1393','ArsC'),(55,'gnl|CDD|239510','Glutaredoxin (GRX) family, GRX bacterial class 1 and 3 (b_1_3)-like subfamily; composed of bacterial GRXs, approximately 10 kDa in size, and proteins containing a GRX or GRX-like domain. GRX is a glutathione (GSH) dependent reductase, catalyzing the disulfide reduction of target proteins such as ribonucleotide reductase. It contains a redox active CXXC motif in a TRX fold and uses a similar dithiol mechanism employed by TRXs for intramolecular disulfide bond reduction of protein substrates. Unlike TRX, GRX has preference for mixed GSH disulfide substrates, in which it uses a monothiol mechanism where only the N-terminal cysteine is required. The flow of reducing equivalents in the GRX system goes from NADPH -> GSH reductase -> GSH -> GRX -> protein substrates. By altering the redox state of target proteins, GRX is involved in many cellular functions including DNA synthesis, signal transduction and the defense against oxidative stress. Different classes are known including  E. coli GRX1 and GRX3, which are members of this subfamily.','cd03418','GRX_GRXb_1_3_like'),(56,'gnl|CDD|249878','Glutaredoxin.','pfam00462','Glutaredoxin'),(57,'gnl|CDD|273716','phage/plasmid primase, P4 family, C-terminal domain.  This model represents a clade within a larger family of proteins from viruses of bacteria and animals. Members of this family are found in phage and plasmids of bacteria and archaea only. The model describes a domain of about 300 residues, found generally toward the protein C-terminus. [DNA metabolism, DNA replication, recombination, and repair, Mobile and extrachromosomal element functions, Prophage functions].','TIGR01613','putative_primase'),(58,'gnl|CDD|235927','hypothetical protein; Validated.','PRK07078','PRK07078'),(59,'gnl|CDD|173172','hypothetical protein; Provisional.','PRK14709','PRK14709'),(60,'gnl|CDD|225913','Phage associated DNA primase [General function prediction only].','COG3378','COG3378'),(61,'gnl|CDD|254987','D5 N terminal like.  This domain is found in D5 proteins of DNA viruses and bacteriophage P4 DNA primases phages.','pfam08706','D5_N'),(62,'gnl|CDD|197953','D5 N terminal like.  This domain is found in D5 proteins of DNA viruses and bacteriophage P4 DNA primases phages.','smart00885','D5_N'),(63,'gnl|CDD|253429','Endodeoxyribonuclease RusA.  This family consists of several bacterial and phage Holliday junction resolvase (RusA) like proteins. The RusA protein of Escherichia coli is an endonuclease that can resolve Holliday intermediates and correct the defects in genetic recombination and DNA repair associated with inactivation of RuvAB or RuvC.','pfam05866','RusA'),(64,'gnl|CDD|182075','endodeoxyribonuclease RUS; Reviewed.','PRK09786','PRK09786'),(65,'gnl|CDD|226936','Holliday junction resolvase [DNA replication, recombination, and repair].','COG4570','Rus'),(66,'gnl|CDD|214794','SprT homologues.  Predicted to have roles in transcription elongation. Contains a conserved HExxH motif, indicating a metalloprotease function.','smart00731','SprT'),(67,'gnl|CDD|255861','SprT-like family.  This family represents a domain found in eukaryotes and prokaryotes. The domain contains a characteristic motif of the zinc metallopeptidases. This family includes the bacterial SprT protein.','pfam10263','SprT-like'),(68,'gnl|CDD|222856','polynucleotide kinase; Provisional.','PHA02530','pseT'),(69,'gnl|CDD|250393','tRNA-splicing ligase RtcB.  This family of RNA ligases (EC:6.5.1.3) join 2\',3\'-cyclic phosphate and 5\'-OH ends. They catalyse the splicing of tRNA and may also participate in tRNA repair and recovery from stress-induced RNA damage.','pfam01139','RtcB'),(70,'gnl|CDD|224604','Uncharacterized conserved protein [Function unknown].','COG1690','RtcB'),(71,'gnl|CDD|181972','hypothetical protein; Reviewed.','PRK09588','PRK09588'),(72,'gnl|CDD|274417','release factor H-coupled RctB family protein.  Members of this family are related to RctB. RctB a protein of known structure but unknown function that often is encoded near RNA cyclase and therefore is suggested to be a tRNA or mRNA processing enzyme. This family of RctB-like proteins in encoded upstream of, and apparently is translationally coupled to, the putative peptide chain release factor RF-H (TIGR03072), product of the prfH gene. Note that a large deletion at the junction between this gene and the prfH gene in Escherichia coli K-12 marks both as probable pseudogenes. [Protein synthesis, Other].','TIGR03073','release_rtcB'),(73,'gnl|CDD|252098','Uncharacterized protein family (UPF0150).  This family of small proteins is uncharacterized. In CC_3185 this domain is found next to a DNA binding helix-turn-helix domain pfam01402, which suggests that this is some kind of ligand binding domain. The structure of this domain suggests that these domains oligomerise and due to structural similarities may bind to RNA. The monomer adopts an alpha-beta-beta-beta-alpha fold and forms a homotetramer. Based on the properties and functions of structural homologues of the HB8 monomer, the protein is speculated to be involved in RNA metabolizm, including RNA binding and cleavage.','pfam03681','UPF0150'),(74,'gnl|CDD|257720','HNH endonuclease.  This HNH nuclease domain is found in CRISPR-related proteins.','pfam13395','HNH_4'),(75,'gnl|CDD|250911','HNH endonuclease.','pfam01844','HNH'),(76,'gnl|CDD|238038','HNH nucleases; HNH endonuclease signature which is found in viral, prokaryotic, and eukaryotic proteins. The alignment includes members of the large group of homing endonucleases, yeast intron 1 protein, MutS, as well as bacterial colicins, pyocins, and anaredoxins.','cd00085','HNHc'),(77,'gnl|CDD|214702','HNH nucleases.','smart00507','HNHc'),(78,'gnl|CDD|224321','Restriction endonuclease [Defense mechanisms].','COG1403','McrA'),(79,'gnl|CDD|187774','CRISPR/Cas system-associated protein Cas9.  CRISPR (Clustered Regularly Interspaced Short Palindromic Repeats) and associated Cas proteins comprise a system for heritable host defense by prokaryotic cells against phage and other foreign DNA; Very large protein containing McrA/HNH-nuclease related domain and a RuvC-like nuclease domain; signature gene for type II.','cd09643','Csn1'),(80,'gnl|CDD|273840','CRISPR subtype II/NMENI RNA-guided endonuclease Cas9/Csn1.  CRISPR loci appear to be mobile elements with a wide host range. This model represents a protein found only in CRISPR-containing species, near other CRISPR-associated proteins (cas), as part of the NMENI subtype of CRISPR/Cas locus. The species range so far for this protein is animal pathogens and commensals only.','TIGR01865','conserved_hypothetical_protein');
